  const [count, setCount] = useState(0);
  return (
    <div>
      <button onClick={() => setCount(count + 0)}>Increase Count</button>
      <MyComponent value={count} />
      {/* <MyPureComponent value={count} /> */}
    </div>
  );
}

export default App;
